import React from "react";
import { withRouter, Redirect } from "react-router-dom";
import { compose } from "redux";
import { connect } from "react-redux";
import Admin from "../Admin/Admin";
import Teacher from "../Teacher/Teacher";
import Student from "../Student/Student";

import { Route } from "react-router-dom";

const Home = ({ profile }) => (
  <>
    {console.log(profile)}
    {profile.p_role === 1 && (
      <Route path="/home/teacher" exact render={() => <Teacher />} />
    )}

    {profile.p_role === 0 && (
      <Route path="/home/admin" exact render={() => <Admin />} />
    )}
    {profile.p_role === 2 && (
      <Route path="/home/student" exact render={() => <Student />} />
    )}

    {!profile && <Redirect exact to="/" />}
  </>
);

const mapStateToProps = ({ profile }) => ({ profile });

const enhance = compose(withRouter, connect(mapStateToProps, null));

export default enhance(Home);
